            <p className="card-text text-center mt-2"> Rs 400/-<span style={{margin:'5px',fontSize:'7px',fontStyle:'italic'}}>Rs 500/-(10%)off</span></p>
          </div>
          </div>
        </div>
        </div>






      </div>
      </>
  );
};

export default Testproduct;
